import React from 'react'
import Text from '../data/home.json';

const Header = () => {
    return (
        <div className='mb-4 text-4xl'>&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;&#x1F680;</div>
    )
}

const Button = () => {
    return (
        <div className='bg-yellow-400 text-white font-medium text-lg w-full mb-4 p-2 rounded-lg'>Join our snap groupchat!</div>
    )
}

const Render = () => {
    return (
        <>
            <div class='container flex justify-content-center align-content-center'>
                <div className='rounded bg-white max-w-6xl p-8'>
                    <Header />
                    <div className='mb-3 font-bold text-4xl leading-normal whitespace-pre-wrap'>{Text.Title}</div>
                    <div className='text-lg mb-3'>{Text.Para}</div>
                    <Button />
                </div>
            </div>
        </>
    )
}

export default Render
